INSERT INTO `t_app_notification` (`id`, `description`, `status`, `notify_time`, `create_date`) VALUES
(1, '便利でおトクなトライアルアプリ\r\nスマホだけでポイントも貯まるし、お買い物もできる！\r\n毎週おトクなクーポンを配信（貯まるクーポン）\r\n貯まったポイントで商品がお得にもらえます（お試しクーポン）\r\n使えば使うほどお得なアプリです！', NULL, NULL, '2018-11-02 08:41:08'),
(2, 'お得なクーポンの使い方\r\n\r\n１．マイストアを設定してください\r\n２．クーポン画面からお得なクーポンを選択してください\r\n３．お店でその商品を探してください\r\n４．カートかクーポン対応のレジでお会計してください\r\n５．クーポンでポイント倍率が増えたり、ポイントが付与されます\r\n\r\nトライアルアプリでお得なお買い物をお楽しみください。', NULL, NULL, '2018-11-06 08:34:05'),
(4, 'スマホでレジ待ちなくお買い物ができます\r\n\r\n１．お買い物メニューを選択します\r\n２．お買い物する店舗を選択します\r\n３．商品をスキャンします\r\n４．お支払い操作をします\r\n５．表示されたバーコードをお会計エリアで読ませます\r\n６．レシートを受け取ってお店を出られてください\r\n\r\n少量のお買い物に便利です。', NULL, NULL, '2018-11-06 10:06:02'),
(6, 'Xperiaをお使いのお客様へ\r\n\r\nお買い物から商品をスキャンされる際に、バーコードが読み取れないという問題が出ています。\r\n\r\nその場合は以下を試していただけますようお願いします。\r\n\r\n１．「ホーム画面」→「カメラ」を開く→「歯車（画面左下）」を選択→「その他の設定」を選択します\r\n\r\n２．「その他の設定」画面にて「タッチ追尾フォーカス（またはタッチ撮影）」をオン（青色）にしていることを確認してください\r\n※カメラアプリの撮影動作が変わる場合がありますのでご注意ください。', NULL, NULL, '2018-11-10 08:18:46'),
