(297, 'スマホでレジ待ちなくお買い物ができます\r\n多の津店でも利用可能になりました\r\n\r\n１．お買い物メニューを選択します\r\n２．お買い物する店舗を選択します\r\n３．商品をスキャンします\r\n４．お支払い操作をします\r\n５．表示されたバーコードをお会計エリアで読ませます\r\n\r\n少量のお買い物に便利です。', 1, '2018-12-20 19:09:00', '2018-12-19 09:12:44'),
(298, '', NULL, NULL, '2018-12-20 05:00:16'),
(299, 'ポイントをお得に商品と交換できるクーポンです。\r\n\r\n■まずはクーポンをゲット\r\n1. クーポン画面の右上「お試しクーポン」を押します\r\n2. 欲しい商品があったら、利用するを押します\r\n　クーポンを選択するとポイントが引かれます\r\n　クーポンは４８時間有効です。引き換えはお早めに。\r\n\r\n■店頭でクーポンを商品と交換\r\n1. お店でお試しクーポン対象商品を探してください\r\n2. アプリクーポン対象レジで購入してください\r\n\r\nトライアルアプリでお得なお買い物をお楽しみください', NULL, NULL, '2018-12-20 14:54:24'),
(300, '', NULL, NULL, '2018-12-21 05:00:15'),
